data.pageSchema:
{
  "renderer": "page",
  "body": [
    {
      "renderer": "wrapper",
      "classname": "i-hesuan",
      "body": [
        {
          "renderer": "wrapper",
          "classname": "i-border-img"
        },
        {
          "renderer": "wrapper",
          "name": "green_card_running",
          "classname": "i-border-running"
        },
        {
          "renderer": "html",
          "html": "<%=dayjs().format('YYYY[年]MM[月]DD[日]')%>",
          "classname": "i-border-current"
        },
        {
          "renderer": "html",
          "html": "<%=dayjs().format('HH:mm:ss')%>",
          "classname": "i-border-current_time"
        },
        {
          "renderer": "upload",
          "name": "upload",
          "label": "",
          "preview": true,
          "validType": "normal",
          "listType": "picture-card",
          "classname": "i-border-header",
          "limit": 1,
          "feedbackConfig": {}
        },
        {
          "renderer": "html",
          "html": "<%=dayjs().format('MM-DD HH:mm')%>",
          "classname": "i-border-search"
        },
        {
          "renderer": "html",
          "html": "<%=dayjs().add(1, 'day').format('MM-DD')%> 24:00",
          "classname": "i-border-endtime"
        }
      ]
    }
  ],
  "steps": [
    {
      "element": "green_card_running",
      "popover": {
        "title": "点击切换头像",
        "description": "不给国家添堵，防疫人人有责"
      }
    }
  ],
  "innerStyle": ".i-website__header {
    background: #4481F6;
    .el-button {
        background: transparent;
    }
}
.i-website__footer {
    display: none;
}    
.i-website__main {
    padding: 0 !important;
}
.i-hesuan {
    position: relative;
    width: 422px;
    height: 860px;
    margin: auto;
    background-image: url('https://songshuzhong.github.io/i-assets/public/img/hesuan.jpg');
    background-size: 100%;
    background-repeat: no-repeat;
}
.i-border-header {
    position: absolute;
    top: 121px;
    left: 50%;
    width: 215px;
    height: 175px;
    transform: translate(-50%);
    z-index: 20;
    .el-upload-list__item,
    .el-upload--picture-card {
        width: 213px;
        height: 213px;
    }
}
.i-border-current {
    position: absolute;
    top: 50px;
    left: 50%;
    width: 154px;
    text-align: center;
    color: #6D6D6D;
    background: white;
    z-index: 100;
    transform: translate(-50%);
    font-size: 18px;
}
.i-border-current_time {
    position: absolute;
    top: 74px;
    left: 50%;
    width: 140px;
    text-align: center;
    color: #6D6D6D;
    background: white;
    z-index: 100;
    transform: translate(-50%);
    font-size: 18px;
}
.i-border-search {
    position: absolute;
    bottom: 180px;
    right: 46px;
    padding: 0 4px;
    color: #6D6D6D;
    background: white;
    z-index: 100;
    font-size: 19px;
}
.i-border-endtime {
    position: absolute;
    bottom: 149px;
    right: 46px;
    padding: 0 4px;
    color: #E44F4E;
    background: white;
    z-index: 100;
    font-size: 19px;
}
.i-border-img {
    position: absolute;
    top: 107px;
    left: 50%;
    height: 307px;
    width: 60%;
    background: white;
    z-index: 1;
    transform: translate(-50%);
}
.i-border-running {
    position: absolute;
    top: 111px;
    left: 50%;
    height: 232px;
    width: 56%;
    transform: translate(-50%);
    background: linear-gradient(90deg, #5DC03C 50%, transparent 0) repeat-x,
        linear-gradient(90deg, #5DC03C 50%, transparent 0) repeat-x,
        linear-gradient(0deg, #5DC03C 50%, transparent 0) repeat-y,
        linear-gradient(0deg, #5DC03C 50%, transparent 0) repeat-y;
    background-size: 16px 4px, 16px 4px, 4px 16px, 4px 16px;
    background-position: 0 0,0 100%, 0 0,100% 0;
    animation: linearMove .3s infinite linear;
    z-index: 10;
}
@keyframes linearMove {
    100% {
        background-position: 16px 0, -16px 100%, 0 -16px, 100% 16px;
    }
}"
}
